import React from 'react'
import {ContactCard} from './react-contact-card'
import './react-sidebar.css'

function Sidebar(props)
{
    return(
        <div id="side-bar">
            <img id="side-bar-avatar" src={props.avatarUrl} alt="Avatar image" />
            <h1 id="side-bar-name">{props.name}</h1>
            <h2 id="side-bar-description">{props.description}</h2>
            <ContactCard 
            email={props.email}
            facebook={props.facebook}
            instagram={props.instagram}
            youtube={props.youtube}
            />
        </div>
    )
}

export {Sidebar}
